/* @jsx mdx */
  import React from 'react'
  import { mdx } from '@mdx-js/react'
  /* @jsx mdx */


const makeShortcode = name => function MDXDefaultShortcode(props) {
  console.warn("Component " + name + " was not imported, exported, or provided by MDXProvider as global scope")
  return <div {...props}/>
};

const layoutProps = {

};
const MDXLayout = "wrapper"
export default function MDXContent({
  components,
  ...props
}) {
  return <MDXLayout {...layoutProps} {...props} components={components} mdxType="MDXLayout">
    <p>{`Our LOAD is the air valve.  There is what's called a "pull down" resistor on the NPN transistor that makes sure that if the Arduino IO isn't giving a strong value, the NPN input is tied to ground, which turns off an NPN transistor.  The P MOSFET has a "pull up" resistor, which does the same thing if the NPN transistor is giving a weak output.  A P channel transistor is off if its input is high.`}</p>
    <p>{`Since our LOAD is a solenoid, which is a type of inductor coil, it will discharge current in a backwards direction when it's turned off.  In order to protect the transistors we will include a diode across the load.  A diode allows current to flow in only one direction.  We will point the diode so that when the transistor turns the valve on, no current will flow through it, but any current created by the valve when it turns off will flow through the diode, protecting the transistor.`}</p>
    <h3 {...{
      "id": "building-the-circuits"
    }}>{`Building the Circuits`}</h3>
    <p><strong parentName="p">{` Parts List `}</strong></p>
    <p>{`We will create two valve control circuits, and the pressure measurement circuit.  We'll need the following parts:`}</p>
    <ul>
      <li parentName="ul"><a parentName="li" {...{
          "href": "http://www.amazon.com/Starter-Kit-Newsite-Uno-Breadboard/dp/B0051QHPJM/ref=sr_1_cc_1?s=aps&ie=UTF8&qid=1397853336&sr=1-1-catcorr&keywords=arduino+holder"
        }}>{`An Arduino Kit (Uno)`}</a><ul parentName="li">
          <li parentName="ul">{`Arduino Uno`}</li>
          <li parentName="ul">{`USB cable`}</li>
          <li parentName="ul">{`Breadboard`}</li>
          <li parentName="ul">{`plenty of jumper wires`}</li>
        </ul></li>
      <li parentName="ul"><a parentName="li" {...{
          "href": "https://www.sparkfun.com/products/11508"
        }}>{`6 10k  resistors`}</a></li>
      <li parentName="ul"><a parentName="li" {...{
          "href": "https://www.sparkfun.com/products/11507"
        }}>{`1 270  resistor`}</a></li>
      <li parentName="ul"><a parentName="li" {...{
          "href": "https://www.sparkfun.com/products/12852"
        }}>{`2 NPN transistors (5 V input)`}</a></li>
      <li parentName="ul"><a parentName="li" {...{
          "href": "https://www.sparkfun.com/products/10349"
        }}>{`2 P channel MOSFETs (5 V input)`}</a></li>
      <li parentName="ul"><a parentName="li" {...{
          "href": "https://www.sparkfun.com/products/8589"
        }}>{`2 diodes`}</a></li>
      <li parentName="ul"><a parentName="li" {...{
          "href": "https://www.sparkfun.com/products/10811"
        }}>{`1 DC barrel jack adapter`}</a></li>
      <li parentName="ul"><a parentName="li" {...{
          "href": "http://www.amazon.com/gp/product/B0027C16H0/ref=oh_details_o01_s00_i00?ie=UTF8&psc=1"
        }}>{`1 15V (or so) power supply`}</a></li>
      <li parentName="ul"><a parentName="li" {...{
          "href": "http://www.monoprice.com/Product?c_id=105&cp_id=10513&cs_id=1051303&p_id=5622&seq=1&format=2"
        }}>{`1 CAT6 keystone jack`}</a></li>
      <li parentName="ul">{`about 6 inches of CAT5 or CAT6 cable, preferably solid core (bulk cable is usually solid, patch cables are usually stranded - solid plugs into a breadboard more easily)`}</li>
    </ul>
    <p>{`In order to make it easy to connect to the valves and sensor, we included a CAT6 keystone jack.  The circuit board will be connected to the control assembly (valves and sensor) through a network cable.  This makes it easier to set up and tear down the launcher.`}</p>
    <p>{`*`}<strong parentName="p">{`* WARNINGS **`}</strong></p>
    <ul>
      <li parentName="ul">{`The direction of the diodes matters.  If you put them in backwards you are short circuiting your transistors.`}</li>
      <li parentName="ul">{`Don't plug the 15 V into the Arduino power jack.  It fits, but it's way too much power.  You could damage the Arduino.`}</li>
      <li parentName="ul">{`Different transistors may use different pins than the ones in the diagrams/pictures.  If you aren't using the same parts listed above, make sure the pins match for base, collector, and emitter (or gate, source, and drain).  If they don't match, adjust your wiring accordingly.`}</li>
    </ul>
    <p>{`Put all together, it should look like this:`}</p>
    <p><a parentName="p" {...{
        "href": "images/noderocket-launcher_electronics_bb.png"
      }}><img alt="project circuit layout" src={require("./images/launcher_circuit_small.png")} /></a></p>
    <p><a parentName="p" {...{
        "href": "images/noderocket-launcher_electronics_bb.png"
      }}>{`Larger Version`}</a></p>
    <p><a parentName="p" {...{
        "href": "images/noderocket-launcher_electronics.fzz"
      }}>{`Fritzing File`}</a></p>
    <p>{`And here is a real life version:`}</p>
    <p><a href="images/launcher_control_board.jpg"><img src="images/launcher_control_board.jpg" alt="Spark Core" style="width: 500px;" /></a>{`
`}<a parentName="p" {...{
        "href": "images/launcher_control_board.jpg"
      }}>{`Larger Version`}</a></p>
    <h3 {...{
      "id": "using-a-spark-core"
    }}>{`Using a Spark Core`}</h3>
    <img src="images/spark.jpg" alt="Spark Core" style="width: 500px;" />
    <p>{`The `}<a parentName="p" {...{
        "href": "https://www.spark.io/"
      }}>{`Spark Core`}</a>{` is a small, Arduino compatible board with Wifi built in.  It's close to a drop in replacement for the Arduino in our control system circuit, with a couple key differences:`}</p>
    <ul>
      <li parentName="ul">{`The Spark Core is a 3.3V system, not a 5V system.`}</li>
      <li parentName="ul">{`The data connection is WiFi, not USB.`}</li>
    </ul>
    <p><strong parentName="p">{` Dealing with 3.3V `}</strong></p>
    <p>{`Our circuit is expecting 5V - that's what works best with our transistors.  The Spark Core is powered by USB, which is 5V.  The Vin pin outputs 5V.`}</p>
    <p>{`The analog pins can't handle 5V, only 3.3V.  That means we need to make sure our pressure sensor never gives the analog pin more than 3.3V.  There are two ways to do this:`}</p>
    <ul>
      <li parentName="ul">{`Use a 3.3V pin as the power supply to the voltage divider (only the voltage divider).`}</li>
      <li parentName="ul">{`Power the voltage divider from 5V, but make sure max that can reach the analog pin is 3.3V or under.`}</li>
    </ul>
    <p>{`I'm using the first solution, which is easy to adjust for in the software.`}</p>
    <p>{`Here's the circuit with a spark device:`}</p>
    <img src="images/spark_circuit.jpg" alt="Spark Core Circuit" style="width: 500px;" />
    <p><strong parentName="p">{` Connecting without USB `}</strong></p>
    <p>{`This is mostly handled with a software change.  The noderocket-launcher project includes a "spark" branch that has the updates needed to connect to a spark device.  Here's what you need to do:`}</p>
    <ul>
      <li parentName="ul">
        <p parentName="li">{`Register your spark device at `}<a parentName="p" {...{
            "href": "https://www.spark.io"
          }}>{`https://www.spark.io`}</a>{`.`}</p>
      </li>
      <li parentName="ul">
        <p parentName="li">{`Prepare the spark device following the instructions for `}<a parentName="p" {...{
            "href": "https://github.com/rwaldron/spark-io/"
          }}>{`the spark-io project`}</a>{`.`}</p>
      </li>
      <li parentName="ul">
        <p parentName="li">{`Clone the `}<a parentName="p" {...{
            "href": "https://github.com/noderockets/noderocket-launcher"
          }}>{`noderocket-launcher project`}</a>{` and switch to the spark branch.`}</p>
      </li>
      <li parentName="ul">
        <p parentName="li">{`Find your Spark Access Token at `}<a parentName="p" {...{
            "href": "https://www.spark.io/build"
          }}>{`https://www.spark.io/build`}</a>{` under the Settings section.`}</p>
      </li>
      <li parentName="ul">
        <p parentName="li">{`Find your spark device's Device ID at `}<a parentName="p" {...{
            "href": "https://www.spark.io/build"
          }}>{`https://www.spark.io/build`}</a>{` under the Cores section.`}</p>
      </li>
      <li parentName="ul">
        <p parentName="li">{`Start the launcher server using:`}</p>
        <pre parentName="li"><code parentName="pre" {...{}}>{`  node server.js --token <your token> --deviceId <your device id>
`}</code></pre>
      </li>
    </ul>
    <h3 {...{
      "id": "building-the-valve-assembly"
    }}>{`Building the Valve Assembly`}</h3>
    <p>{`We need the valves and pressure sensor connected such that:
1. We can connect an air pressure source.
2. We can connect a rocket launch platform.
3. The fill valve controls air into the rocket.
4. The pressure sensor senses the air pressure of the rocket.
5. The launch valve has pressure when the rocket is ready to launch.
6. The launch valve loses pressure when the rocket is launched.`}</p>
    <p><strong parentName="p">{` Parts List `}</strong></p>
    <p>{`We'll need the following parts:`}</p>
    <ul>
      <li parentName="ul"><a parentName="li" {...{
          "href": "http://www.amazon.com/Electric-Solenoid-Replacement-Pipelines-Applications/dp/B00827FP26/ref=sr_1_sc_2?ie=UTF8&qid=1395697129&sr=8-2-spell"
        }}>{`2 12 V air valves`}</a></li>
      <li parentName="ul"><a parentName="li" {...{
          "href": "http://www.amazon.com/gp/product/B00029JXMA/ref=oh_details_o00_s00_i00?ie=UTF8&psc=1"
        }}>{`1 oil pressure sensor`}</a><ul parentName="li">
          <li parentName="ul">{`1 1/8 NPT female to 1/4 NPT male adapter (comes with the pressure sensor linked)`}</li>
        </ul></li>
      <li parentName="ul"><a parentName="li" {...{
          "href": "http://www.harborfreight.com/piece-brass-industrialmilton-uick-connect-starter-set-68237.html"
        }}>{`2 Quick connect starter sets`}</a><ul parentName="li">
          <li parentName="ul">{`2 Female quick connect to 1/4 NPT female`}</li>
          <li parentName="ul">{`2 Male quick connect to 1/4 NPT male`}</li>
        </ul></li>
      <li parentName="ul"><a parentName="li" {...{
          "href": "http://www.harborfreight.com/14-female-brass-t-connector-68197.html"
        }}>{`2 1/4 NPT tees`}</a></li>
      <li parentName="ul"><a parentName="li" {...{
          "href": "http://www.harborfreight.com/14-x-14-Female-Brass-Pipe-Coupling-68200.html"
        }}>{`1 1/4 NPT female coupling`}</a></li>
      <li parentName="ul"><a parentName="li" {...{
          "href": "http://www.harborfreight.com/14-in-x-14-in-male-brass-pipe-coupling-68198.html"
        }}>{`3 1/4 NPT male coupling`}</a></li>
      <li parentName="ul"><a parentName="li" {...{
          "href": "http://www.amazon.com/dp/B000BOAA6O/ref=biss_dp_t_asn"
        }}>{`1 1/8 NPT male to 1/4 NPT female coupling`}</a></li>
      <li parentName="ul"><a parentName="li" {...{
          "href": "http://www.amazon.com/gp/product/B005JGR0GM/ref=oh_details_o00_s00_i00?ie=UTF8&psc=1"
        }}>{`1 pneumatic cylinder`}</a></li>
      <li parentName="ul"><a parentName="li" {...{
          "href": "http://www.amazon.com/K-Tool-International-KTI72000-Rubber-Whip/dp/B00BEEF52E/ref=sr_1_2?s=hi&ie=UTF8&qid=1397851143&sr=1-2"
        }}>{`1-2 foot hose 1/4 NPT male on both ends to connect valve to cylinder`}</a></li>
      <li parentName="ul"><a parentName="li" {...{
          "href": "http://www.harborfreight.com/60-ft-x-34-in-industrial-grade-electrical-tape-69570.html"
        }}>{`Electrical tape`}</a></li>
      <li parentName="ul"><a parentName="li" {...{
          "href": "http://www.amazon.com/Machine-Plated-Phillips-Threaded-Imported/dp/B00F32EKMO/ref=sr_1_1?ie=UTF8&qid=1401656736&sr=8-1&keywords=m5+screw+10mm"
        }}>{`M5 screw to connect the sensor ground to a valve body`}</a></li>
      <li parentName="ul"><a parentName="li" {...{
          "href": "http://www.harborfreight.com/1-2-half-inch-x-260-inch-plumbers-thread-seal-tape-39625.html"
        }}>{`pipe thread tape`}</a></li>
      <li parentName="ul"><a parentName="li" {...{
          "href": "http://www.monoprice.com/Product?c_id=105&cp_id=10513&cs_id=1051303&p_id=5622&seq=1&format=2"
        }}>{`1 CAT6 keystone jack`}</a></li>
      <li parentName="ul">{`about 6 inches of CAT5 or CAT6 cable, preferably solid core (bulk cable is usually solid, patch cables are usually stranded - solid plugs into a breadboard more easily)`}</li>
    </ul>
    <p><img alt="launcher control parts" src={require("./images/launcher_control_parts.png")} /></p>
    <p>{`Assemble them as shown in the picture - make sure to apply tape to the threads of each male piece before assembling.  Tighten the connections.  It should look like this when assembled:`}</p>
    <p><img alt="launcher control assembly" src={require("./images/launcher_control_assembly.png")} /></p>
    <p>{`The pneumatic cylinder isn't pictured as it's bolted on to the launch platform.  It has a male quick connect and the hose connecting it to the valve has a female quick connect so that the control assembly is removed from the launch platform via two quick connects - one to the rocket fill and the other to the pneumatic cylinder.`}</p>
    <p>{`And both sides assembled with CAT6 keystone jacks - a network cable completes the connection between the two:`}</p>
    <p><img alt="launcher control and circuit" src={require("./images/launcher_control_cat6.png")} /></p>
    </MDXLayout>;
}

MDXContent.isMDXComponent = true;
